// store.js
import { configureStore } from "@reduxjs/toolkit";
import ordersReducer from "./reducers/orders"; // Correct the import path

export default configureStore({
  reducer: {
    orders: ordersReducer,
    // Add other reducers if needed, for example:
    // books: bookReducer,
  },
});
